import Link from 'next/link';

const Header: React.FunctionComponent = () => (
  <header className="header">
    <nav>
      <Link href="/">
        <a>Home</a>
      </Link>
      <Link href="/about">
        <a>About</a>
      </Link>
    </nav>
    <style jsx>
      {`
        a {
          font-family: 'Lato', sans-serif;
          margin-right: 16px;
        }
      `}
    </style>
  </header>
);

export default Header;
